If you mean that you want to use 0-3 pipes and 0-1 pays in your shell, then you can do that by using the `pipe` and `dup2` system calls in your shell code.

Here is an example of how you might use the `pipe` system call to create a pipe in your shell:
```
int fd[2];
pipe(fd);
```
This will create a pipe and store the file descriptors for the read and write ends of the pipe in the `fd` array. You can then use the `dup2` system call to redirect the standard input or output of a process to the pipe:
```
dup2(fd[1], STDOUT_FILENO);
close(fd[0]);
close(fd[1]);
```
This will redirect the standard output of the current process to the write end of the pipe, and then close the read and write ends of the pipe.

You can use a similar approach to implement pipes and pays in your shell. To implement a pay, you can use the `dup2` system call to redirect the standard input or output of a process to a file or another process.

